import React, { Component } from 'react';
import "./App.css"
class App extends Component {
  render() {
    return (
      <div className="App">
          <form className="well form-horizontal">
            <fieldset>
            <div className="form-group">
              <div class= "col-md-8 inputGroupContainer">
                <div class="input-group"><span class="input-group-addon"><i class="glyphicon glyphicon-user"></i></span><input id="fullName" name="fullName" placeholder="Full Name" class="form-control" required="true" value="" type="text"></input>
                </div>
              </div>
            </div>
            </fieldset>
          </form>

      </div>
    );
  }
}

export default App;
